import React, { ReactElement, useEffect, useState } from "react";
import styled from "styled-components/native";

import { ScrollView } from "react-native";
import { View, H1, TextInput, Button, Text } from "../../styles";
import { Feather } from "@expo/vector-icons";

import HomeCard from "./HomeCard";
import { GET } from "../../utils/request";

const HomeTop = styled(View)`
  background-color: #fff;
  height: 50px;
  margin: 20px;
  flex-direction: row;
  border-bottom-width: 1px;
  border-bottom-color: #fefefe;
`;

const HomeListDiv = styled(ScrollView)`
  flex: 1;
`;

const SearchBar = styled(TextInput)`
  background-color: ${(props: any) => props.theme.background};
  height: 100%;
  flex: 1;
  color: #fefefe;
  font-size: 1.5rem;
  padding: 5px;
  border-width: 0;
`;

const SearchIcon = styled(View)`
  background-color: ${(props: any) => props.theme.background};
  align-items: center;
  justify-content: center;
  padding: 10px;
`;

interface Props {}

export default function HomeList({}: Props): ReactElement {
  const [rooms, setRooms] = useState([]);

  useEffect(() => {
    GET("/rooms").then(setRooms);
  }, []);

  return (
    <React.Fragment>
      <HomeTop>
        <SearchIcon>
          <Feather name="search" size={24} color="#fefefe" />
        </SearchIcon>
        <SearchBar placeholder="Search" />
      </HomeTop>

      <HomeListDiv>
        <HomeCard></HomeCard>
        <HomeCard></HomeCard>
        <HomeCard></HomeCard>
        <HomeCard></HomeCard>
        <HomeCard></HomeCard>
        <HomeCard></HomeCard>
        <HomeCard></HomeCard>
        <HomeCard></HomeCard>
        <HomeCard></HomeCard>
        <HomeCard></HomeCard>
        <HomeCard></HomeCard>
      </HomeListDiv>
    </React.Fragment>
  );
}
